import './Header.css';

const Header = () => {
    return (
        <>
            <div className="navbar">
                <div className="navbar-left">
                    <a href="#" class="nav-link">Home</a>
                    <a href="#" class="nav-link">Logout</a>
                </div>
                <div className="navbar-right">
                    <img src="./alarm-icon.png" alt="Alarm Icon" />
                    <a href="#" class="icon-link"><img src="notification-icon.png" alt="Notification Icon" /></a>
                    <a href="#" class="icon-link"><img src="profile-icon.png" alt="Profile Icon" /></a>
                </div>
            </div>
        </>
    )
};

export default Header;
